(lambda _: kAssert(({**{}, **{}}) == {}))(None)
(lambda _: kAssert(({**{"a": 1}, **{}}) == {"a": 1}))(None)
(lambda _: kAssert(({**{}, **{"b": 2}}) == {"b": 2}))(None)
(lambda _: kAssert(({**{"a": 1}, **{"b": 2}}) == {"a": 1, "b": 2}))(None)
(lambda _: kAssert(({**{"a": 1}, **{"a": 2}}) == {"a": 2}))(None)
(lambda _: kAssert(({**{"a": 1, "b": 2}, **{"b": 3, "c": 4}}) == {"a": 1, "b": 3, "c": 4}))(None)
(lambda _: kAssert(({**{"x": {"nested": 1}}, **{"y": 2}}) == {"x": {"nested": 1}, "y": 2}))(None)
(lambda _: kAssert(({**{"x": {"a": 1}}, **{"x": {"b": 2}}}) == {"x": {"b": 2}}))(None)
(lambda _: kAssert(kDeepMerge({}, {}) == {}))(None)
(lambda _: kAssert(kDeepMerge({"a": 1}, {}) == {"a": 1}))(None)
(lambda _: kAssert(kDeepMerge({}, {"b": 2}) == {"b": 2}))(None)
(lambda _: kAssert(kDeepMerge({"a": 1}, {"b": 2}) == {"a": 1, "b": 2}))(None)
(lambda _: kAssert(kDeepMerge({"a": 1}, {"a": 2}) == {"a": 2}))(None)
(lambda _: kAssert(kDeepMerge({"x": {"a": 1}}, {"x": {"b": 2}}) == {"x": {"a": 1, "b": 2}}))(None)
(lambda _: kAssert(kDeepMerge({"x": {"a": 1, "b": 1}}, {"x": {"b": 2}}) == {"x": {"a": 1, "b": 2}}))(None)
(lambda _: kAssert(kDeepMerge({"a": {"b": {"c": 1}}}, {"a": {"b": {"d": 2}}}) == {"a": {"b": {"c": 1, "d": 2}}}))(None)
(lambda _: kAssert(kDeepMerge({"x": [1, 2]}, {"x": [3, 4]}) == {"x": [3, 4]}))(None)
(lambda _: kAssert(kDeepMerge({"a": 1}, {"a": {"b": 2}}) == {"a": {"b": 2}}))(None)
(lambda _: kAssert(kDeepMerge({"a": {"b": 2}}, {"a": 1}) == {"a": 1}))(None)
